import React from 'react'

function Login () {
  return (
    <>
      <h1>Please Sign In</h1>
      <button onClic>Login</button>
    </>
  )
}

function SignUp () {
  return (
    <>
      <h1>Welcome Back</h1>
      <button>Sign Up</button>
    </>
  )
}

class App extends React.Component {
  constructor () {
    super()
    this.state = {
      toggle: true
    }
  }

  handleLogin () {
    console.log('login')
  }

  render () {
    if (this.state.toggle) return <Login onClick={() => this.handleLogin()} />
    return <SignUp />
  }
}

export default App
